import React from 'react';

class ImagePopup extends React.Component {
    constructor(props) {
      super(props);
    }

    render() {
      return (
        <div className='popup popup_type_image'>
            <div className="popup__overlay"></div>
            <div className="popup__image-container">
                <button type="button" className='popup__close-btn popup__close-btn_area_image'
                aria-label="кнопка-закрыть"/>
                <figure className="popup__image">
                    <img src="images/arhyz_view.png" alt="Архыз" className="popup__image-content" />
                    <figcaption className="popup__image-caption">Архыз</figcaption>
                </figure>
            </div>
        </div>
      );
    }
  } 

export default ImagePopup
